import "./Expenses.css";
import ExpenseItems from "./ExpensItems";
import Card from "../UI/Card";
import ExpensesFilter from "./ExpensesFilter";

function Expenses(props) {
    // props.items.forEach((obj) => console.log(obj));
    const filterChangeHandler = (selectedYear) => {
        console.log(selectedYear);
    };

    return (
        <Card className="expenses">
            <ExpensesFilter onChangeFilter={filterChangeHandler} />
            <ExpenseItems expense={props.items[0]} />
            <ExpenseItems expense={props.items[1]} />
            <ExpenseItems expense={props.items[2]} />
            <ExpenseItems expense={props.items[3]} />
        </Card>
    );
}

export default Expenses;
